import { Avatar, Grid } from "@mui/material";
import React from "react";
import { Box } from "@mui/system";
import image from "../assets/akash.jpg";
import styles from "./profilepage.module.css";
import CompanyName from "../assets/instawhite.png";


const Profilepage = () => {
  return (
    <div className={styles.main}>
        <div className={styles.header}> <img
            className={styles.logo}
            src={CompanyName}
            alt="logo"
            height={50}
            width={200}
          /></div>
      <div>
        <Grid container spacing={0} >
          <Grid xs={4} md={4} lg={4} sd={4}>
            <Box
              sx={{
                width: "100%",
                height: 84,
                pt:2,
                backgroundColor: "black",
                "&:hover": {
                  backgroundColor: "primary.main",
                  opacity: [0.9, 0.8, 0.7],
                },
              }}
            >
              {" "}
              <Avatar
                alt="Remy Sharp"
                sx={{ ml: 4, width: 77, height: 77 }}
                src={image}
              />
            </Box>
          </Grid>
          <Grid xs={8} md={8} lg={8} sd={8}>
            <Box
              sx={{
                width: "100%",  
                height: 84,
                backgroundColor: "red",
                "&:hover": {
                  backgroundColor: "primary.main",
                  opacity: [0.9, 0.8, 0.7],
                },
              }}
            >
                <h2>Siddharth PAtel</h2>
                <p>10 posts</p>

            </Box>
          </Grid>
        </Grid>
      </div>
    </div>
  );
};

export default Profilepage;
